pragma solidity ^0.4.17;

import "./domain.sol";


contract DomainToken {

    struct Record {
        address owner;
        bytes32 endpoint;
        string protocal;
    }

    mapping(bytes32 => Record) public records;

    event Transfer(bytes32 domain, address newOwner);
    event EndPointSet(bytes32 domain,bytes32 endpoint);
    event Registerd(bytes32 domain,address newOwner);
    event ProtocalSet(bytes32 domain, string newProtocal);

    modifier ownership(bytes32 domain) {

        require(msg.sender == records[domain].owner);
        _;
        } 

    function DomainToken() {
        records[42].owner = msg.sender;
    }

    function lookup(bytes32 domain) public returns (bytes32) {
        return records[domain].endpoint;
    }

    function getProtocal(bytes32 domain) public returns (string) {
        return records[domain].protocal;
    }

    function owner(bytes32 domain) public returns (address) {
        return records[domain].owner;
    }

    function register(bytes32 domain) public returns (bool) {
        if (records[domain].owner == 0) {
            records[domain].owner = msg.sender;
            Registerd(domain,msg.sender);
            return true;

        }else {
            return false;
            }
        }

    function setEndpoint(bytes32 domain, bytes32 endpoint) ownership(domain) public returns (bool) {
        records[domain].endpoint = endpoint;
        EndPointSet(domain,endpoint);
        return true;
    }

    function transfer(bytes32 domain, address newOwner) ownership(domain) public returns (bool) {
        records[domain].owner = newOwner;
        Transfer(domain, newOwner);
        return true;
    }

    function changeProtocal(bytes32 domain, string protocal) ownership(domain) public returns (bool) {
        records[domain].protocal = protocal;
        ProtocalSet(domain,protocal);
        return true;
    }
}
